import useCart from '../Cart/handler/getCartHandler'

export function Cart() {
    const cart = useCart();
    console.log(cart);
    return (
        <div>
            {cart.map((product) => (
                <div>
                    <h2>product.name</h2>
                </div>
            ))}
        </div>
    );
}
